L’improvvisazione dar forma a qualcosa man mano che lo si fa. Prendere decisioni che non erano pianificate prima. È meraviglioso. La prima regola è far tesoro di tutte le informazioni seguendo sempre l’idea che ti viene comunicata dall’altra persona. E solo allora si raggiunge l’armonia. Uno spettacolo si può preparare in un mese, improvvisare,invece,richiede una vita. Grazie @giulianopeparini  per avermi dato l’opportunità di accompagnare @massimilianovarrese in questa prova, con un tema super importante e delicato. Il nostro è stato uno scambio viscerale e autentico. Per un danzatore professionista sentirsi stimolato giorno dopo giorno è vitale. Ed è anche grazie a questo tipo di prove che continuo a crescere e a non dire le stesse cose, perché le vie di comunicazione sono infinite. 
Good Job @massimilianovarrese
 Ti voglio bene. 
@giulianopeparini Thank you Man. ♥️
@barbarellacappi @zanforlinluca  i vostri occhi mi hanno sempre aiutato. ♥️
